import axios from 'axios'

export default class World {
    constructor(props) {
	this.state = {
	    preset: this.getPreset(),
	}
    }
    componentDidMount(){
	this.getPreset();
    }

    getPreset() {
	axios
	    .get('http://127.0.0.1:8000/api/worlds/1/')
	    .then(res => {
		this.state.preset = res.data.preset;
	    }).catch(err => {
		console.log(err);
	    });
    }

}
